var count,total,cur_no = 0;

function clickNext(){
    if(cur_no == (total-1)){
        return;
    } else{
        $(".headerSmallDiv img").eq(cur_no).hide();
        cur_no =cur_no+ 1;
        $(".headerSmallDiv img").eq(cur_no).show();
    }
}
function clickPrev(){
    if(cur_no == 0){
        return;
    }else{
        $(".headerSmallDiv img").eq(cur_no).hide();
        cur_no =  cur_no -1;
        $(".headerSmallDiv img").eq(cur_no).show();}
}

$(function(){
    $(".headerSmallDiv img").eq(cur_no).show();
    $("#menuul a").last().css("margin","0")
    count = $("#banner_list a").length;
    total = $(".headerSmallDiv img").length;
})